import React from 'react';

function Login({ onSignupClick, onLoginSubmit }) {
  return (
    <div className="login">
      <h2>Login Page</h2>
      <form onSubmit={(e) => { e.preventDefault(); onLoginSubmit(); }}>
        <input type="text" placeholder="Username" required />
        <input type="password" placeholder="Password" required />
        <button type="submit">Login</button>
      </form>
      <p>
        Don't have an account? <span onClick={onSignupClick} style={{ color: 'blue', cursor: 'pointer' }}>Sign Up</span>
      </p>
    </div>
  );
}

export default Login;
